import React from "react";

const Contact = () => {
  return (
    <div className="mt-32 h-screen bg-[#E6DACE]">
      <div className=" w-[43rem] my-0 mx-auto h-screen">
        <div className="flex items-center justify-center gap-3 py-28 ">
          <div className="w-5 h-5 bg-blue-800"></div>
          <h1 className=" text-3xl font-bold tracking-wide">LET'S TALK</h1>
        </div>
        <div className="flex flex-col bg-white">
          <label htmlFor="fname">First Name</label>
          <input type="text" id="fname" required />
          <label htmlFor="lname">Last Name</label>
          <input type="text" id="lname" required />
          <label htmlFor="email">Email</label>
          <input type="email" id="email" required />
          <label htmlFor="subject">Subject</label>
          <input type="text" id="subject" />
          <label htmlFor="message">Message</label>
          <input type="text" id="message" />
        </div>
      </div>
    </div>
  );
};

export default Contact;
